import React, { useState } from 'react';
import AirPods from './AirPods';
import AppleCore from './AppleCore';
import Cart from './Cart';
import Hearts from './Hearts';
import IMac from './IMac';
import IPad from './IPad';
import IPhone from './IPhone';
import Mac from './Mac';
import MacBook from './MacBook';
import Price from './Price';
import TVandHome from './TVandHome';
import Watch from './Watch';

export default function Search() {
   const [search, setSearch] = useState('');

   return (
      <>
         <input
            type="text"
            placeholder="Search..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
         />
         <AirPods search={search} hidden />
         <AppleCore search={search} hidden />
         <Cart search={search} hidden />
         <Hearts search={search} hidden />
         <IMac search={search} hidden />
         <IPad search={search} hidden />
         <IPhone search={search} hidden />
         <Mac search={search} hidden />
         <MacBook search={search} hidden />
         <Price search={search} hidden />
         <TVandHome search={search} hidden />
         <Watch search={search} hidden />
      </>
   );
}
